        Я, Джон Уорт, в должности Представитель Центрального Командования, разрешаю использовать Службе Безопасности экспериментальное оборудование для проведения [color=green]санкционированных[/color] казней: [color=red]крупный измельчитель[/color].


        Данное оборудование находится в комнате для проведения казней, что находится в бриге и не должно быть перемещено.


        Краткая инструкция по использованию оборудования и техника безопасности:

        1) посадить предварительно закованное существо, приговорённое к смертной казни, на стул, и разместить его на конвейере перед крупным измельчителем;

        2) убедиться, что на конвейере нет посторонних лиц и на нём находится исключительно приговорённое к смертной казни существо;

        3) перевести рычаг в крайнее правое положение: это откроет бронеокно и приведёт весь механизм в действие;

        4) после того, как механизм закончит работу, следует отключить его путём перевода рычага в среднее положение;

        5) при необходимости, можно перевести рычаг в крайнее левое положение, таким образом запустив конвейер в обратном направлении.


        Санкции в отношении сотрудников, что злоупотребили использованием оборудования.


        При использовании оборудования не по назначению и если это не повлекло серьёзных последствий, виновный должен быть наказан по статье действующего Корпоративного Закона под номером 142 - халатность.


        При использовании оборудования не по назначению и если это повлекло за собой жертвы, обвиняемому должно быть выдвинуто обвинение по статье действующего Корпоративного Закона под номером 216 - уничтожение тела.

